import React from 'react';
import TextField from '@material-ui/core/TextField';

class Catalog extends React.Component {
  constructor(props) {
    super(props);

    this.onEnter = this.onEnter.bind(this);
  }

  onEnter(e) {
    e.preventDefault();
    if (e.keyCode !== 13) { }


  }

  render() {
    return (
      <div>
        <TextField  onKeyUp={this.onEnter} />
        {this.props}
      </div>
    );
  }
}

export default Catalog;
